import React from 'react';

const NavBar = () => {
  return  (
  	<nav>
	    <div className="nav-wrapper orange lighten-3">
	    <ul class="left hide-on-med-and-down">
        <li><a href=""><i class="material-icons">subdirectory_arrow_right</i></a></li>
        </ul>
	    <h5 className="brand-logo girlNextDoor center">Westiny</h5>
	    <ul class="right hide-on-med-and-down">
        <li><i class="material-icons">person_pin</i></li>
        <li><a>Julia Kroger</a></li>
        <li><a href=""><i class="material-icons">subdirectory_arrow_right</i></a></li>

      </ul>
	    </div>
	</nav>

	);
}

export default NavBar;
